var title_f5_28_5575="ECG of atrial enlargement";
var content_f5_28_5575=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F64928&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F64928&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 476px\">",
"   <div class=\"ttl\">",
"    Electrocardiograms showing atrial enlargement",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 285px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    P wave morphology with atrial enlargement in leads I, II, and V1. The P waves in left atrial enlargement (left panel) are wide (&gt;0.12 sec) and notched in leads I and II and the terminal segment has a negative deflection that is deep and delayed in V1. In right atrial enlargement (middle panel), the P wave amplitude is increased (0.28 mV) in lead II. Biatrial enlargement (right panel) has characteristics of both atrial abnormalities: the P wave amplitude (0.22 mV) and duration (0.12 sec) are increased in lead II and there is deep terminal negativity in V1.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
