"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/28/5576/contributors\">",
"     Section Editors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/28/5576/contributors\">",
"     Timothy O Lipman, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/28/5576/contributors\">",
"     Freek Verheugt, MD, FACC, FESC",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/28/5576/contributors\">",
"     Deputy Editor",
"    </a>",
