var title_f5_28_5577="Trypanosoma cruzi life cycle";
var content_f5_28_5577=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F53632&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F53632&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 630px\">",
"   <div class=\"ttl\">",
"    Life cycle of",
"    <em>",
"     Trypanosoma cruzi",
"    </em>",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 610px; height: 475px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An infected triatomine insect vector (or \"kissing\" bug) takes a blood meal and releases trypomastigotes in its feces near the site of the bite wound. Trypomastigotes enter the host through the wound or through intact mucosal membranes, such as the conjunctiva (1). Common triatomine vector species for trypanosomiasis belong to the genera",
"    <em>",
"     Triatoma, Phodinius,",
"    </em>",
"    and",
"    <em>",
"     Panstrongylus",
"    </em>",
"    . Inside the host, the trypomastigotes invade cells near the site of inoculation, where they differentiate into intracellular amastigotes (2). The amastigotes multiply by binary fission (3) and differentiate into trypomastigotes, and then are released into the circulation as bloodstream trypomastigotes (4). Trypomastigotes infect cells from a variety of tissues and transform into intracellular amastigotes in new infection sites. Clinical manifestations can result from this infective cycle. The bloodstream trypomastigotes do not replicate (different from the African trypanosomes). Replication resumes only when the parasites enter another cell or are ingested by another vector. The \"kissing\" bug becomes infected by feeding on human or animal blood that contains circulating parasites (5). The ingested trypomastigotes transform into epimastigotes in the vector's midgut (6). The parasites multiply and differentiate in the midgut (7) and differentiate into infective metacyclic trypomastigotes in the hindgut (8).",
"    <em>",
"     Trypanosoma cruzi",
"    </em>",
"    can also be transmitted through blood transfusions, organ transplantation, transplacentally, and in laboratory accidents.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Centers for Disease Control and Prevention.",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/trypanosomiasisamerican.htm\">",
"      file://www.dpd.cdc.gov/dpdx/html/trypanosomiasisamerican.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
